/photomng/imgpath/201911/11/0b286a53-cf6a-45d8-afb9-d730cb02ad8d.jpg','다학제 진료 시스템으로 구성된 질환별 전문 진료 센터 및 전문 클리닉을 운영하고 있으며 응급의료센터의 전문화, 비침습-중재적 시술팀의 진료로 빠르고 안전한 진료와 치료가 이루어진다.\n외국인 방문객은 물론 재외동포, 국내에 체류하고 있는 외국인이 편안한 마음으로 진료를 받을 수 있도록 외국인 특화 진료시스템을 운영하고 있으며 첨단 의료장비와 고객의 상태에 적합한 의료진 배치를 통해 최고의 의료서비스를 제공한다. ','관광지','33.4920436','126.4713907','064-786-7000','Null','제주특별자치도 제주시 월랑로 91','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/11/a2f87004-20ee-4515-986a-5391706627bc.jpg','중앙병원'),('CNTS_200000000009474','제주시 삼도일동 518','https://api.cdn.visitjeju.net/photomng/imgpath/201911/11/611edf66-611c-4856-a8a3-5d45edc35b22.JPG','1983년 2월 제주 최초의 종합병원으로 설립된 이후 ‘앞서가는 진료, 정성이 깃든 간호, 친절한 응대를 통한 고객에게 기쁨을 드리는 병원’이라는 비전을 가지고 최고의 고객만족을 실현하는 병원을 만들고자 노력하고 있다. \n각 분야별 전문의료진의 체계적인 협진진료로 ONE-STOP 의료서비스를 제공하고 있다.','관광지','33.5003822','126.5167845','064-750-0000','Null','제주특별자치도 제주시 서광로 193','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/11/e7ada91d-1070-4273-b62a-698c67f46881.JPG','한국병원'),('CNTS_200000000009479','제주시 한림읍 협재리 2838','https://api.cdn.visitjeju.net/photomng/imgpath/201911/12/607e4218-4ef6-4659-9c1c-3b4a762650cc.JPG','국내외 고객 및 환자를 대상으로 최고의 안티에이징 의료서비스와 성형 및 메디컬스킨케어를 제공하고 있다. 건강과 아름다운 외모로 고객의 삶의 질을 높이는 것을 목표로 천혜의 자연에서 누리는 힐링과 개인별 맞춤 의료프로그램으로 효과적인 관리와 결과를 약속한다. ','관광지','33.3760556','126.2441268','064-798-9900','Null','제주특별자치도 제주시 한림읍 금능남로 127','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/12/c1113d42-6083-4eb1-a5f0-372cb62d2425.JPG','썬플라워의원'),('CNTS_200000000009480','서귀포시 동홍동 1530-2','https://api.cdn.visitjeju.net/photomng/imgpath/201911/12/6263a360-bace-4cfd-ab73-fc3d6dcedd98.jpg','1964년 제주도립병원 서귀포분원으로 개원하여 2013년 10월, 지하2층 지상4층으로 신축이전하여 현재 18개 진료과와 300병상을 갖춘 서귀포시의 유일한 종합병원으로 128체널 CT, 3.0T MRI 등 첨단 의료장비 도입을 통해 최적의 진료환경을 구축했다. 또한 심·뇌혈관센터운영, 고압산소센터운영, 24시간 분만산부인과 운영, 안과개설 등 지역특성에 맞는 진료센터를 통해 진료의 수준을 한단계 더 높였다. 또한 제주도 최초 간병부담을 덜어주는 간호·간병통합서비스병동 운영을 통해 지역 주민의 의료비 부담을 최소화 하였고, 취약계층 의료지원 및 예방접종사업, 찾아가는 산부인과 등의 다양한 공공의료사업을 전개해 나가고 있다. ','관광지','33.2557649','126.5645342','064-730-3000','Null','제주특별자치도 서귀포시 장수로 47','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/12/7ba9bbb0-740d-4f10-bfa4-91a36c892422.jpg','서귀포의료원'),('CNTS_200000000009481','제주시 노형동 682','https://api.cdn.visitjeju.net/photomng/imgpath/201911/12/a3468c1c-a104-4299-ab33-f4752ce05e69.JPG','아름다운 얼굴과 건강한 몸은 모든 여성들의 꿈이다. 조선한의원은 한방 피부 미용과 다이어트 프로그램을 통하여 여성들에게 건강한 아름다움을 되찾는데 도움을 준다. \n전통 한의학 이론과 최신 서양 의학 지식을 결합한 차별화 된 진료에서 자연스럽고 건강한 아름다움을 만나보자.','관광지','33.48309800000001','126.4772312','064-712-7775','Null','제주특별자치도 제주시 진군남4길 7-1','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/12/06376f61-0e0b-4f76-9bc8-86b8a185b93c.JPG','조선한의원'),('CNTS_200000000009482','제주시 노형동 1296-5 명은빌딩 2,3,5,7층','https://api.cdn.visitjeju.net/photomng/imgpath/201911/13/41dbc157-0683-44cd-ad09-87c1290aa84d.jpg','어떤피부도 자신있는 피부전문병원, 아름다운피부과!\n첫째, 모든의료진은 피부과전문의\n둘째, 모든기기는 안전하게 정품사용\n셋째, 모든제품은 정직하게 정량사용\n지난 18년간 22만여명이선택한  아름다운피부과. 각종피부질환의 치료 뿐만 아니라, 한류피부미용의 선두에서 수많은 저통증고효율 시술을 개발하였다.','관광지','33.4867644','126.4799813','064-746-7114','Null','제주특별자치도 제주시 도령로 5 명은빌딩 2,3,5,7층','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/13/ee0c7163-2f5a-4271-8b95-c0994c5e89f5.jpg','아름다운피부과'),('CNTS_200000000009483','제주시 연동 1963-2','https://api.cdn.visitjeju.net/photomng/imgpath/201911/13/80147126-0e29-4979-bfca-8fd469591e18.jpg','환자의 생명과 건강을 내 몸처럼 돌본다는 뜻의 ‘이명아명’(爾命我命)을 원훈으로 삼고, 1983년 10월 개원했다. 병원 규모는 지하 2층, 지상 10층 규모의 건물 2동에 26개 진료과목을 개설하고 600 병상을 보유하고 있는 제주지역 최대 병원이다. 2011년부터 정부가 공인하는 의료기관으로, 역량있는 의료진과 첨단 의료장비를 갖추고 있으며, 중증 응급(외상)환자를 최종 진료하는 권역응급의료센터와 권역외상센터를 운영하며, 골든아워내 적절한 치료로 단 한 사람의 생명이라도 잃는 일이 없도록 노력하고 있다.','관광지','33.4898195','126.4851928','064-740-5000','Null','제주특별자치도 제주시 도령로 65','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/13/b5affb04-e412-4af2-994e-9d9cde18de9d.jpg','제주한라병원'),('CNTS_200000000009484','제주시 연동 1375','https://api.cdn.visitjeju.net/photomng/imgpath/201911/13/7995f166-950d-4a95-bb3c-c15e3e9a5a4a.jpg','감염병 예방 및 관리, 비전염성 만성질환의 조기 발견과 예방을 위한 효율적인 건강검진을 위하여 진료과목별 전문 의료진과 우수한 의료 인력, MRI, 128ch MDCT, HD급 내시경검사기 등 최첨단 의료장비를 갖추고 있으며, \n고객중심의 의료 서비스를 제공하기 위해 검진 예약에서부터 검진 과정 그리고 검진 후 관리까지 완벽한 시스템을 구축하여 안전, 안심, 신속, 정확한 고품격 건강검진을 제공하고 있다.','관광지','33.48212170000001','126.4933841','064-740-0200','Null','제주특별자치도 제주시 연북로 111','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/13/0c207eca-bd24-4ae0-b933-411dfe92b5ee.jpg','한국건강관리협회제주특별자치도부'),('CNTS_200000000009485','제주시 아라일동 6035-1 반디빌딩 5층','https://api.cdn.visitjeju.net/photomng/imgpath/201911/13/13a4d845-d69e-4bde-8893-2d47dd378867.jpg','아름다운 한라산이 시원하게 펼쳐지는 멋진 환경과 깨끗한 시설 및 첨단 장비들을 갖추고 전문 진료진들과 함께 믿을 수 있고 편안한 치료를 위해 최선을 다하고 있다. 특히 투명고정, 치아미백, 심미보철치료와 같은 안모의 심미개선과 기능향상을 위한 연구에 많은 시간과 노력을 기울이고 있다. 흐르는 시냇물처럼 언제나 깨끗하고 새로운 지식을 탐구하며 수준 높은 진료를 제공하도록 노력한다.','관광지','33.4558924','126.5620301','064-758-2800 ','Null','제주특별자치도 제주시 연북로 527 반디빌딩 5층','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/13/67806216-bcb2-4d6c-9db2-63123163b689.jpg','이편한치과'),('CNTS_200000000009486','제주시 이도이동 1986-3','https://api.cdn.visitjeju.net/photomng/imgpath/201911/13/4984fac6-ac25-4b07-84ce-3828ea1fad73.JPG','척추ㆍ관절 치료로 특화된 병원으로서, 각 분야 최고의 실력을 가진 전문의사들이 입체적 협진 치료시스템을 통해 신뢰할 수 있는 최상의 의료 서비스를 제공한다. \n제주도의 지리적인 특성으로, 척추ㆍ관절 환자의 One stop System( 진료-검사ㆍ결과 )을 도입하여 당일 입원 당일 퇴원이 가능하며, 최소한의 보존적 치료만으로도 회복될 수 있는 기회를 제공하고 있다. \n척추ㆍ관절 질환의 최소절개, 최소침습, 무수혈 치료를 원칙으로, 내시경치료를 전문적으로 시행하는 병원이다.','관광지','33.4891486','126.5393964','1899-6265','Null','제주특별자치도 제주시 중앙로 373','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/13/5d073c89-f766-41ce-b710-7c9b17fd0bee.JPG','제주우리병원'),('CNTS_200000000009487','제주시 연동 282-52 2층','https://api.cdn.visitjeju.net/photomng/imgpath/201911/13/f0bb188b-bdbf-49fc-a180-81766ffe0508.jpg','한국 고유의 의학인 사상체질의학을 전문으로 진료하고 있다. 사상체질을 검사하고 확진한 뒤 사상체질에 맞는 음식과 생활법을 안내한다. \n또 전통적인 기법이 살아있는 왕뜸, 부항, 수지침요법의 효능을 직접 체험할 수 있다.','관광지','33.4879178','126.4928566','Null','Null','제주특별자치도 제주시 신대로14길 36 2층','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/13/af2000ae-7b42-41e5-951b-150b5076145a.jpg','제원한의원'),('CNTS_200000000009489','제주시 한림읍 한림리 1197-1','https://api.cdn.visitjeju.net/photomng/imgpath/201911/14/faa498aa-5962-4280-8f29-f7fe7fb5fcbb.jpg','제주도 서쪽 한림읍에 위치한 한의원으로, 한의학박사 한방내과전문의 원장이 진료하고 있다. 현대인들의 만성적인 어깨통증, 피로, 두통, 어지럼증, 불면증 등을 침과 한약 등 한의학적 치료법으로 효과적으로 치료하고 있다. 또한 우리 몸의 여러가지 증상이나 만성적인 질환들을 체질적인 특징으로 체계화한 한국 고유의 사상체질의학 치료도 하고 있다. ','관광지','33.4120056','126.2653772','064-796-0909','Null','제주특별자치도 제주시 한림읍 한림중앙로 31','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/14/fc0d10e6-79f3-4b38-b74e-0850ea63adc8.jpg','아침한의원 '),('CNTS_200000000009490','서귀포시 색달동 2558','https://api.cdn.visitjeju.net/photomng/imgpath/201911/15/0dec0b8f-41a1-421c-8beb-7004cb131f54.jpg','생태문화전시관 <더 플래닛>은 신비롭고 소중한 제주도의 자연을 새롭게 발견할 수 있도록 아이부터 어른까지 누구나 즐길 수 있는  다양한 전시와 콘텐츠가 준비된 공간이다.','관광지','33.2814107','126.4111118','064-798-2000','Null','제주특별자치도 서귀포시 천제연로 70','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/15/ce25431d-6bcf-4ac3-bafe-22e92d6973d4.jpg','더 플래닛(THE PLANET)'),('CNTS_200000000009496','서귀포시 안덕면 서광리 산 39','https://api.cdn.visitjeju.net/photomng/imgpath/201911/19/faaf1ce3-ff87-408f-9d7f-60e57749a255.JPG','신화전설 탐방로 ‘신나락 만나락’은 제주도를 본뜬 모양에 총 5개 코스와 14개 조형물 쉼터로 조성되어 있다.','관광지','33.3029712','126.2990679','064-797-5773','Null','제주특별자치도 서귀포시 안덕면 녹차분재로 218','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/19/80cd1ff6-e8ea-4da5-9578-34d9b0e35024.JPG','제주신화전설탐방로'),('CNTS_200000000009497','서귀포시 성산읍 삼달리 1185-2','https://api.cdn.visitjeju.net/photomng/imgpath/201911/19/f437e678-82e3-444c-a13d-70dfc85e63b3.JPG','위대한 작가 반고흐의 지난 삶을 보고 듣고 만질 수 있는 \'고흐의 정원\'','관광지','33.3726076','126.855539','064-783-6700','Null','제주특별자치도 서귀포시 성산읍 삼달신풍로 126-5','https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/19/3fbed28c-f983-4169-8e4f-e2f0ade3caab.JPG','고흐의 정원'),('CNTS_200000000009500','제주시 애월읍 신엄리 2768-7','https://api.cdn.visitjeju.net/photomng/imgpath/201911/19/210756cd-4590-42b6-9819-5a655c8cab08.JPG','빌라드애월호텔 전시관으로 기간별로 다양한 전시를 만나볼 수 있