','인디언키친'),('CNTS_200000000009858','제주시 한경면 두모리 288','https://api.cdn.visitjeju.net/photomng/imgpath/202002/20/a8a754fb-3179-4202-b9ad-53e7675c8021.jpg','한림읍에 위치한 연리지가든은 축산진흥원에서 재래 흑돼지를 분양받아 약 4,000평 규모의 농장에서 방목해 사육한다. \n농장에서 키우는 개체 수가 한정적이다 보니 하루에 판매할 수 있는 고기 양도 정해져 있고, 특정 부위만 주문하는 것도 불가능하다. 보통 목살과 삼겹살, 다리 부위 등이 섞여 나오는데 어느 것 하나 맛이 떨어지지 않는다. \n*예약불가','음식점','33.336132','126.1989307','064-796-8700','Null','제주특별자치도 제주시 한경면 두조로 190-20','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/20/a0420a67-37c5-4fb0-b162-0ea929c069db.jpg','늘푸른농원 연리지가든'),('CNTS_200000000009859','제주시 이도일동 1289-5','https://api.cdn.visitjeju.net/photomng/imgpath/202002/20/58959e94-82b3-4aab-8445-9513b21ee894.jpg','구제주시내에 있는 감초식당은 채소와 당면, 피가 어우러진 보통의 순대와 다르게 제주식 순대는 피와 메밀, 찹쌀을 주재료로 순대를 만든다. 창자 안을 가득 채운 소는 신선하고 고소한 맛이 진하게 묻어난다. 푸딩같이 부드러운 식감 또한 매력적이다.\n','음식점','33.5032944','126.527915','064-753-7462','Null','제주특별자치도 제주시 동광로1길 32','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/20/e488165a-8645-4d74-9487-14e527ddc452.jpg','감초식당'),('CNTS_200000000009860','제주시 구좌읍 종달리 478-14','https://api.cdn.visitjeju.net/photomng/imgpath/202002/20/d0d0e286-0e82-4fa2-a17b-6c852c4a7b2f.jpg','종달해녀의 집은 제주도 동쪽 해안 마을인 종달리 어촌계가 직영하는 식당으로, 이곳에서는 건강한 맛이 가득한 전복죽을 맛볼 수 있다. 제주산 전복을 얇게 저며 내장과 함께 푹 끓여낸 죽은 보기만 해도 영양가 높게 느껴진다.\n','음식점','33.4971443','126.9109521','064-783-1752','Null','제주특별자치도 제주시 구좌읍 해맞이해안로 2276','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/20/e69b6ba5-542d-4ff4-8dfd-a8a8ccf20c48.jpg','종달해녀의집'),('CNTS_200000000009861','제주시 오라이동 779-1','https://api.cdn.visitjeju.net/photomng/imgpath/202002/20/2dcae3c8-af5d-4ca4-8026-d44164792098.jpg','제주시 오라동에 위치한 마마무말가든은 제유영농법인이 운영한다. 제주 토종 말 가운데서도 육질이 뛰어난 3~5살 가량의 말고기를 사용하기 때문에 모든 요리에서 누린내를 전혀 느낄 수 없다. 그야말로 신선하고 담백한 말고기 본연의 맛을 느낄 수 있다. ','음식점','33.4723452','126.508143','064-724-2992','Null','제주특별자치도 제주시 아연로 157','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/20/90f4bcef-c006-45fb-8c8c-5e193275efe5.jpg','마마무말가든'),('CNTS_200000000009862','서귀포시 남원읍 남원리 180-5','https://api.cdn.visitjeju.net/photomng/imgpath/202002/20/ac27523e-aa2f-4c3c-9c48-d69c1cf4dfaf.jpg','서귀포시 남원읍에 위치한 토향은 시원한 맛이 일품인 옥돔국과 생선구이가 전문인 식당이다.','음식점','33.2798479','126.718896','064-764-3300','Null','제주특별자치도 서귀포시 남원읍 태위로679번길 7-1','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/20/b65340e8-f258-4bc8-a0de-5e339878135d.jpg','토향(음식점)'),('CNTS_200000000009863','제주시 오라이동 산 100','https://api.cdn.visitjeju.net/photomng/imgpath/202002/20/f586694e-8471-43ba-8e21-1101c25e5abe.JPG','제주미래교육연구원 과학탐구체험장은 한라산이 올려다 보이는 산록북로 가운데 위치해있다. 한라산을 옆에 두고 달리다 보며 어느새 과학탐구체험장에 닿는다. 이곳에는 아이들은 물론 어른들도 흥미롭게 관람할 수 있는 시설들이 많다. ','관광지','33.3616666','126.5291666','064-710-0800','Null','제주특별자치도 제주시 산록북로 421','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/20/3ae59bdc-e71b-4f6c-ba27-dd390a99393d.JPG','제주미래교육연구원 과학탐구체험장'),('CNTS_200000000009864','제주시 연동 463','https://api.cdn.visitjeju.net/photomng/imgpath/202002/20/a7b89ea8-1d50-44eb-8322-6130fccf62e0.JPG','꿈바당 어린이 도서관은 원래 대통령이 제주도를 방문할 때 묵어가던 지방 공간이었다. 1984년 건립된 이후 전두환과 노태우, 김영삼 전 대통령이 총 11회에 걸쳐 이용했으며 1996년 경호시설에서 해제되면서 한때 제주도지사 관사로 사용되기도 했다. 2014년 도민 품으로 돌아온 건물은 여러 논의 끝에 2017년 꿈바당 어린이 도서관으로 새롭게 탈바꿈했다. ','관광지','33.480735','126.5002152','064-745-7101','Null','제주특별자치도 제주시 연오로 140','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/20/379586d2-b1d1-49ff-b6c8-c61d0ae6261f.JPG','꿈바당 어린이도서관'),('CNTS_200000000009865','제주시 한림읍 월림리 산 8','https://api.cdn.visitjeju.net/photomng/imgpath/202002/21/9e536f1f-d302-474a-9d95-3b0f8f91bad6.JPG','더마파크 안에 자리한 라온주(ZOO)는 포유류와 파충류, 조류, 어류에 이르기까지 전 세계의 다양한 동물을 만나는 실내체험동물원이다. 약 50여 종의 동물들이 있으며 실내 공간이기 때문에 비가 오거나 날씨가 궂은 날에도 언제든 관람이 가능하다. ','관광지','33.3555222','126.2420266','064-795-1332','Null','제주특별자치도 제주시 한림읍 월림7길 155','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/21/69470fdf-9472-448e-9bb9-52d328874206.JPG','라온주 실내체험동물원'),('CNTS_200000000009866','서귀포시 표선면 성읍리 2873','https://api.cdn.visitjeju.net/photomng/imgpath/202002/21/d3a1caf2-87b3-4329-8576-4c745eba7f89.JPG','탁 트인 경치를 품은 목장카페 드르쿰다는 동물 먹이주기와 승마, 카트, 이색 자전거 체험까지 즐길 거리가 많은 곳이다. 번영로 대로변에 위치해 찾기 쉽고 편안한 카페와 체험장이 한 공간에 있어 이용하기 편하다. 카페 전망창 너머로는 푸른 들판이 펼쳐진다. ','관광지','33.4091347','126.7701478','064-787-5220','Null','제주특별자치도 서귀포시 표선면 번영로 2454','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/21/69b8c660-5a19-4e66-b727-b9c68fd043bb.JPG','목장카페 드르쿰다'),('CNTS_200000000009869','제주시 구좌읍 행원리 1537-21','https://api.cdn.visitjeju.net/photomng/imgpath/202002/21/273e48e7-043d-4241-b022-83f9a112dfda.jpg','월정리 해변은 바다색이 유난히 투명해 사계절 관광객 발길이 끊이지 않는다. 그곳에 바다만큼 특별함을 담고 있는 떡볶이 집이 있다. 이름부터 미소를 짓게 만드는 방긋스낵이다.','음식점','33.5340986','126.7954364','010-4195-0884','Null','제주특별자치도 제주시 구좌읍 행원로1길 32-5','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/21/8b49249f-a99b-426e-b425-9dc13ff5eac9.jpg','방긋스낵'),('CNTS_200000000009870','제주시 애월읍 소길리 952-2','https://api.cdn.visitjeju.net/photomng/imgpath/202002/21/1d79303f-858a-493d-aa57-881cc1a641d0.JPG','애월읍 중산간 마을에 위치한 멍멍 플레이스는 애견인을 위한 최고의 숙소로 꼽힌다. 강아지와 편안하게 쉴 수 있는 잠자리는 물론 잔디밭에서 맘껏 뛰어 다닐 수 있는 최적의 환경을 갖추고 있다. 반려견과 제주 여행을 계획한다면 한번 눈여겨 볼 필요가 있다. ','관광지','33.4160695','126.3794271','0507-1307-4661','Null','제주특별자치도 제주시 애월읍 소길남길 244-5','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/21/922c7b2d-c8f4-4d65-9b33-2e81b9da7d80.JPG','멍멍플레이스'),('CNTS_200000000009871','제주시 한림읍 대림리 428-13','https://api.cdn.visitjeju.net/photomng/imgpath/202002/21/74d15041-a95b-4ebc-bac8-d6827a74c89d.JPG','브레이브 독스는 반려견을 위한 모든 것을 갖춘 곳이다. 반려견과 잠시 쉬어갈 수 있는 카페부터 유치원과 호텔, 애견 미용까지 한 곳에서 모두 해결할 수 있다. 그야말로 강아지들을 위한 원스톱 공간이다. ','관광지','33.4218294','126.2766113','0507-1313-4026','Null','제주특별자치도 제주시 한림읍 한수풀로 138','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202002/21/50e8d9ef-01e7-4768-8bed-7604ed4538d0.JPG','브레이브독스'),('CNTS_200000000009872','제주시 조천읍 신촌리 2717-4','https://api.cdn.visitjeju.net/photomng/imgpath/202002/21/443e43d6-39b2-4f2b-a594-cb3631daa73f.JPG','카페 비글은 이름 그대로 비글 강아지가 살고 있는 애견 동반이 가능한 아담한 카페다. 카페 주인장이 키우고 있는 비글견 경이와 호야는 손님들이 올 때마다 열렬한 환