'음식점','33.4364202','126.9206412','064-784-7840','-','제주특별자치도 서귀포시 성산읍 신양로 102','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202009/01/75e1e708-4d23-4dd7-b637-d86778ce4134.jpg','섭지코지화덕피자'),('CNTS_200000000010618','서귀포시 대정읍 상모리 87-5','https://api.cdn.visitjeju.net/photomng/imgpath/202111/08/fadaa135-fede-4977-8f89-5300f96251df.jpg','살아있는 통문어가 들어가는 제주도 대표 해물탕과 갈치조림 전문점','음식점','33.2097912','126.2915013','064-794-5678','-','제주특별자치도 서귀포시 대정읍 형제해안로 282','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202111/08/ef1541ab-232d-4ed5-a09c-cc1dfccde51c.jpg','고서방해물탕'),('CNTS_200000000010653','서귀포시 서호동 115','https://api.cdn.visitjeju.net/photomng/imgpath/202009/29/752117d8-a9eb-40e7-955e-8c6dc1f755c7.jpg','2019년 7월 1일 오픈한 골드원 호텔앤스위트는 서귀포혁신도시 바닷가에 위치한 궁전같은 귀족적인 정취를 가진 특급호텔로 제주도에서 가장 뛰어난 풍경을 자랑한다. 365일 운영되는 인피니티 온수풀과 올레7길로 이어지는 시크릿가든, 전객실 오션뷰 자쿠지, 테라스 등 투숙하신 고객님들로부터 럭셔리 부띠크 호텔의 새기준, 5성급보다 더 5성급 같은 호텔이라는 호평을 받고 있다. ','숙박','33.2441806','126.5224316','064) 801-5000','Null','제주특별자치도 서귀포시 이어도로 1032','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202009/29/00c73a02-fd3f-43b4-baff-459fca7bd358.jpg','골드원 호텔 & 스위트'),('CNTS_200000000010695','서귀포시 남원읍 한남리 307-3','https://api.cdn.visitjeju.net/photomng/imgpath/202010/07/d6204c7a-cc0a-4aaa-9e99-497d5879c7b6.jpg','제주도 서귀포시 남원읍은 제주에서도 날씨가 좋은 곳으로 알려진 마을이다. 봄철에는 제주특산물로 유명한 고사리축제가 열리고, 감귤이 익어가는 풍경이 아름다워 ‘귤림추색’(감귤이 익어가는 가을풍경)이라고 불릴 정도. 제주도민들도 남원읍은 살기 좋은 고장이라 한다고.  \n돌담한길펜션은 72년 전통가옥을 현대식으로 리모델링해 내 집처럼 편안한 독채형 펜션이다. 대형 숙박시설이 아니라 단 2개의 객실만 운영하고 있는 소박한 제주 살림집스러운데 실내에 들어서면 70년 전 천장 서까래가 그대로 드러나 옛 분위기가 물씬 풍기고, 안방에는 편백나무 침대가 건강한 수면을 도와주고 창밖으로는 감귤밭이 한눈에 들어온다. 겉은 옛집이지만 화장실, 주방, 거실 등 모든 이용시설은 이용하기 편리한 현대식으로 개조했다.','숙박','33.3352599','126.6681117','010-4690-4303','Null','제주특별자치도 서귀포시 남원읍 한신로 55','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202010/07/dfce190e-0e27-41e3-93a6-65161a89f2b5.jpg','돌담한길펜션'),('CNTS_200000000010696','제주시 회천동 3-16','https://api.cdn.visitjeju.net/photomng/imgpath/202010/07/3bf283df-4294-4142-b211-91de096db263.JPG','제주시 동쪽 중산간 지역으로 공기와 풍광 좋은 아름다운 곳에 한화리조트가 있다. 리조트가 운영하는 테라피센터는 일반적인 리조트의 사우나와는 사뭇 다른 힐링과 치유 위주의 시설을 갖추고 있다. \n','관광지','33.4489935','126.637412','064-786-1300','Null','제주특별자치도 제주시 명림로 575-107 한화리조트 로비층 지하','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202010/07/92fcee53-fa99-4262-a2f7-ed724e731f9b.JPG','한화리조트 테라피센터'),('CNTS_200000000010697','제주시 한림읍 협재리 1607 3층','https://api.cdn.visitjeju.net/photomng/imgpath/202010/07/54dd96f1-6ac8-43d2-970e-b1e619769f19.jpg','사람들은 보통 떠오르는 일출 앞에 서면 소망을 빌거나 앞으로의 각오를 다짐하고는 한다. 반면에 붉은 노을을 바라볼 때는 평소 일상에 지쳐있던 긴장을 내려놓고 분위기에 취한다. 제주시 애월읍 신엄리 신엄포구 앞 해안도로는 해질 무렵 드라이브하기 좋은 코스 중 하나. 이곳에 일상생활에 지친 사람들의 마음과 영혼을 잠시 쉬어가게 해 주는 아늑한 공간이 있다. 제주어로 바다를 뜻하는 ‘바릇’을 붙인 바릇스파가 그 곳이다. 작은 숲 너머 해안도로와 애월 바다가 보이는 올레리조트 단지 안에 위치한 바릇스파는 공간도 아늑한 분위기가 느껴진다. ','관광지','33.3970766','126.244507','064-799-8133','Null','제주특별자치도 제주시 한림읍 한림로 392 3층','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202010/07/1dbca91c-e6f3-4582-83b6-01a60fcfa171.jpg','바릇스파 '),('CNTS_200000000010698','제주시 한림읍 금악리 84-1','https://api.cdn.visitjeju.net/photomng/imgpath/202010/07/63cccfd1-f566-4aa5-bdee-b96c470384c6.jpg','제주의 청정을 그대로 유지한 자연의 품에 안겨 그 속에서 휴식과 회복, 그로부터 신체 나이를 되돌리는 데 도움을 주는 자연주의 스파, 더힐하우스스파가 바로 그곳이다. 더힐하우스스파는 블랙스톤 골프호텔 단지 내에 위치하고 있으며 편안한 분위기와 현대식 시설을 갖춘 전문 스파다. ','관광지','33.355577','126.3056877','064-795-2380','Null','제주특별자치도 제주시 한림읍 한창로 925-122','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202010/07/6e9c0d2f-a13d-4f65-8432-9924ce93c71a.jpg','더힐하우스스파'),('CNTS_200000000010699','서귀포시 남원읍 위미리 4137-1','https://api.cdn.visitjeju.net/photomng/imgpath/202010/07/274d18fe-d03a-434d-a837-851bc9e67ea4.jpg','쪽빛 하늘 아래 감귤밭에 직접 만든 쪽빛 손수건을 널었다. 내 친구는 감물 염색으로 만든 조그만 파우치를 말렸다. 전통 감귤밭에서 감귤따기체험, 전통 감물염색체험을 통해 자신만의 작품을 만들어 볼 수 있는 곳이 있다. 제주의 천연 염색 기법을 그대로 활용한 서귀포시 남원읍 위미리에 위치한 천연염색체험장 \'이음새\' 교육농장이다.','관광지','33.275292','126.6686352','010-6789-1944','Null','제주특별자치도 서귀포시 남원읍 위미리 4137-1','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202010/07/68d9a2b4-5629-4891-8844-2ca7d271e599.jpg','이음새'),('CNTS_200000000010713','제주시 구좌읍 월정리 52 1층','https://api.cdn.visitjeju.net/photomng/imgpath/202010/13/68c23e24-8a76-47ce-a7d9-c157d7134250.jpg','월정리에 위치한 다양한 공예 체험을 할 수 있는 공간','관광지','33.5553143','126.7966528','064-803-0066','-','제주특별자치도 제주시 구좌읍 월정7길 42-6 1층','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202010/13/2f237029-292e-4647-9fdd-7a940af1562a.jpg','공방:하루_반'),('CNTS_200000000010714','제주시 한경면 고산리 2726-1 1층','https://api.cdn.visitjeju.net/photomng/imgpath/202010/13/2243ffb8-8dd5-4745-8355-564af63489f5.jpeg','제주서쪽 한경면 고산리 작은 디저트가게 안녕구움','음식점','33.3053522','126.1791699','064-901-4987','-','제주특별자치도 제주시 한경면 고산로 49 1층','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202010/13/8cb2c93c-b157-459c-980d-dcb9377fe62a.jpeg','안녕구움'),('CNTS_200000000010733','서귀포시 남원읍 남원리 93-11','https://api.cdn.visitjeju.net/photomng/imgpath/202010/19/4b9762f4-2844-436e-b840-c4ab6760951d.jpg','전객실 오션뷰~아름다운 풍경과 낭만이 있는 펜션..서귀포 파도봐펜션 입니다.','숙박','33.2783351','126.720218','064-764-1110','-','제주특별자치도 서귀포시 남원읍 남태해안로 141','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202010/19/061fedba-a9e1-40f6-bf2e-6a3aadc469b1.jpg','파도봐펜션'),('CNTS_200000000010754','제주시 노형동 241-1','https://api.cdn.visitjeju.net/photomng/imgpath/202102/15/01dc93f7-7ce6-48a1-821e-ae16be098468.jpg','\"세상의 건강을 담다\" 솔담한방병원','관광지','33.4592031','126.4850328','064-746-1075','-','제주특별자치도 제주시 1100로 3055','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202102/15/c6c88a69-d9e1-400e-bc89-6fae197b9a70.jpg','솔담한방병원'),('CNTS_200000000010774','제주시 용담삼동 1131','https://api.cdn.visitjeju.net/photomng/imgpath/202011/02/c9d6e955-0a66-4bb3-93cf-a8ad3018c7a9.jpg','아름다운 제주의 해안도로 근처에 위치하고 있으며 심플하고 깔끔한 원룸형 펜션입니다.','숙박','33.5189566','126.4988573','064-747-0909','-','제주특별자치도 제주시 서해안로 572-1','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/02/9ddb0106-c80c-4c04-96a6-11ad7ee68293.jpg','돌꽃펜션'),('CNTS_200000000010794','서귀포시 토평동 3045','https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/595a2bd0-7ff2-44f0-beee-5c307754e9e2.jpg','청재설헌은 ‘Bed and Breakfast’라는 슬로건을 추구한다. 각종 비타민이나 영양식을 추구하는 현대인은 이해 할지 모르겠다. 하지만 우리네 어머니들이 늘 말씀하시던 한결같은 말 중에 “건강하려면 단잠을 자고 제 때 끼니를 잘 먹어야한다”고 하셨다.\n2000년 11월 처음 문을 연 청재설헌은 더도 덜도 없이 그 말 그대로를 실천하는 내츄럴 숙박시설이다. \'Bed\'는 잘 자는 것, ‘Breakfast’는 아침식사를 하는 것을 말한다. 청재설헌에서는 주인과 객이 함께 아침식사를 하는 곳이다. 호화스러운 호텔이나 여타 숙박시설과 달리 청재설헌 건물은 소박하게 지어졌다. 서귀포 토평동 중산간 자락, 한라산 남사면이라 어느 곳이든 한라산 정상이 한눈에 보이는 지역의 특성을 고려한 듯, 숙소 앞 정원에서도 건물 지붕 뒤로 한라산을 가리지 않는다.','숙박','33.2891483','126.5718271','064-732-2020','Null','제주특별자치도 서귀포시 인정오름로 135-18','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/09c2a083-88e5-492c-b9c8-689766a5ca93.jpg','청재설헌'),('CNTS_200000000010795','제주시 구좌읍 김녕리 731','https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/3b080da7-6236-4120-95f4-4b5705d79f76.jpg','제주도에서는 밭농사 작물을 보호하기 위해 밭 외곽에 돌담을 쌓고 바람을 막는다. 그래서 제주 곳곳에서 밭담길을 만날 수 있는데 여기 제주시 김녕마을 뒤쪽에 자리 잡은 제주밭담숲은 중앙에 허브밭과 숙소시설, 체험실 등이 있고 사방이 숲으로 빙 둘러싸여 있는 형세다. 김녕은 제주시 동부권 지역으로 도심의 현대화가 덜 전파된 자연 중심의 지역이다. 제주밭담숲의 시작은 10여 년 전으로 대표가 직접 흙을 구하고 반죽을 빚어 지은 토종 흙집이다. 휴게실 겸 식당건물 뒤쪽에 지어진 7개의 숙소는 바깥쪽은 제주돌집, 내부의 바닥과 벽은 시멘트나 인공 건축 재료를 전혀 사용하지 않은 천연 화산송이 흙으로 세운 친환경주택이라고 할 수 있다. 흙 반죽이 빨리 굳지 않고 바르는데 기술이 필요해 구들 하나 완성하는데 무려 6개월이나 걸렸을 정도라니 그 정성만으로도 충분히 건강한 쉼이 느껴지는 숙소다.','숙박','33.5398407','126.746583','010-3654-1504','Null','제주특별자치도 제주시 구좌읍 김녕남8길 55-64','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/f7729c61-0052-4b21-927d-e1437971de94.jpg','제주밭담숲'),('CNTS_200000000010796','서귀포시 색달동 2812-4','https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/81b8479f-e466-4697-877b-85caaaf30eef.jpg','서귀포시 중문관광단지의 롯데호텔제주는 프리미엄급으로 잘 알려진 휴양시설. 이 곳 별관 1층에 위치한 브이스파는 1905년부터 명성을 이어온 스위스 프리미엄 안티에이징 브랜드 ‘발몽(Valmont)’과 딸라소 테라피의 리더, 프랑스 No.1 해양성 코스메틱 브랜드 ‘딸고(Thalgo)’를 전문으로 사용하는 고품격 스파라고 할 수 있다. 전문교육을 이수한 테라피스트의 섬세한 손길로 진행되는 다양한 프로그램과 고객 한 분만을 위한 프라이빗 서비스는 여행이나 과중한 피로에 지친 몸과 마음의 균형을 찾게 해준다.','관광지','33.2484577','126.4105487','064-731-4007','Null','제주특별자치도 서귀포시 중문관광로72번길 35, lobby floor 8F','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/36af5821-4b0f-4449-a0c3-5576eaa2ff63.jpg','롯데호텔 브이스파'),('CNTS_200000000010797','서귀포시 색달동 2812-10','https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/1d59eb9b-6be4-41ff-a534-150f5b08331a.jpg','스위트호텔 아로마는 추운 겨울여행으로 지친 다리와 몸을 따뜻하게 풀어주는 케어서비스를 제공하며, 중문관광단지에 위치해 쉽게 찾을 수 있다.  중문관광단지 내에 위치한 스위트호텔 아로마는 주변에 호텔 롯데와 신라호텔, 하얏트 등과 근접해 있다. 그럼에도 특급호텔에서 이용할 수 있는 테라피와 비교해 가장 저렴한 이용료와 오랜 경험의 노하우에 따른 케어서비스로 젊은 고객들에게 인기가 높은 아로마 전문샵이다.','관광지','33.2493465','126.4082155','064-738-3969','Null','제주특별자치도 서귀포시 중문관광로72번길 67','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/225b1897-abae-4874-99ed-0ba750123216.jpg','스위트호텔 아로마'),('CNTS_200000000010798','서귀포시 성산읍 고성리 127-2','https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/ecf9ca2b-c55c-4c59-8c30-45f6062c581b.jpg','스파, 커플룸, 프라이빗룸으로 구성된 르쏠레이테라피센터는 성산 휘닉스호텔앤리조트 내에 위치하고, 호텔 스파 중 유일하게 프랑스 ‘달팡’을 경험할 수 있는 곳이다. 호텔 테라피보다 저렴한 가격으로 호텔만큼의 만족을 얻을 수 있는 곳이 휘닉스 르쏠레이테라피라고 할 수 있다. 우선 르쏠레이테라피가 가장 자랑하는 건 전문교육을 이수한 테라피스트들에게 체계적인 케어서비스를 받을 수 있다는 점과 제주에서는 유일하게 프랑스 브랜드 달팡(Darphin) 제품을 사용하고 있다는 것.','관광지','33.4306514','126.9269847','064-731-7709','Null','제주특별자치도 서귀포시 성산읍 섭지코지로 107 휘닉스제주아일랜드리조트 블루동 1층','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/b7623557-c906-45b0-83e4-85559536316c.jpg','휘닉스 르쏠레이테라피'),('CNTS_200000000010799','제주시 조천읍 와흘리 1480-2','https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/8b33065e-a5f4-491b-abb1-9969ff855ae2.jpg','제주시 동쪽 조천읍 와흘에 위치한 제주여가마을은 자신의 여가 분석과 유형별 체험 프로그램을 통해 자신만의 쉬는 법과 노는 법을 터득해 가는 흥미로운 체험마을이다. 제주여가마을 본부가 있는 농촌마을 ‘와흘리’는 세계중요농업유산인 제주밭담의 전통성과 다양성을 잘 보존하여, 제주시가 추진하는 전통밭담을 활용한 힐링 제주 플랫폼 구축사업의 거점마을이기도 하다.','관광지','33.504557','126.6357654','064-783-9949','Null','제주특별자치도 제주시 조천읍 조와로 360','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/5489700a-edcd-4e40-b7f2-c41cdd9ea344.jpg','제주여가마을'),('CNTS_200000000010800','서귀포시 대정읍 가파리 701','https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/7304b09b-467d-4a97-9fa8-2174465a888a.jpg','최남단 마라도 섬투어는 주민이 직접 안내자 겸 해설사가 되어 무인도 시절부터 지금까지 이어진 마라도의 자연과 문화, 역사, 생활사를 들려주는 섬투어 프로그램이다. 선착장이 생기기 전, 제주도에서 정기적인 여객선이 왕래하기 이전 시절의 이야기, 마라도 섬 전체의 안녕을 기원하는 할망당의 당문화, 석달 열흘 넘게 꺼지지 않은 불을 피해 바다 건너로 도망친 뱀 이야기 등 마라도에 얽힌 설화와 재미있는 섬 이야기를 주민이 직접 들려주는 해설 프로그램으로 토박이가 아니고서는 알기 힘든 리얼한 스토리를 들을 수 있어 인기가 많다.','관광지','33.1700179','126.271518','010-6437-1970','Null','제주특별자치도 서귀포시 대정읍 마라로 65','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/7d3f20dd-cf4f-4501-a9fa-6cd53a10d849.jpg','마라도 섬투어'),('CNTS_200000000010801','제주시 구좌읍 세화리 3641-10','https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/8566cf4a-bc03-4fb4-a5ad-334802f188e5.jpg','구좌읍 세화리 마을주민 477명이 모여 만든 세화마을협동조합이 멋진 풍광의 세화리 바닷가에 질그랭이센터를 오픈했다. 지상 4층 규모로 건축된 질그랭이센터는 1층은 세화리사무소가 업무를 보는 공간이고, 2층에는 카페와 로컬푸드 판매점, 3층은 구좌읍주민여행사와 여행자센터를 갖추고 있다. 4층은 여행자들의 쉼을 위해 마련된 숙소로 코로나19 추이를 지켜보며 운영될 예정이다.','관광지','33.48959660000001','126.8316644','010-4928-9298','Null','제주특별자치도 제주시 구좌읍 세평항로 46-9','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/e08731b1-53ea-4d99-8403-f7b8f1693ab7.jpg','질그랭이센터'),('CNTS_200000000010813','제주시 애월읍 어음리 산 131','https://api.cdn.visitjeju.net/photomng/imgpath/202011/04/d18d3324-caa4-4e9d-9b6b-2fa20aa4d433.jpg','애월읍 평화로 인근에 위치한 9.81파크는 새로운 놀이, 무동력레이싱을 경험하고, 다양한 콘텐츠를 즐길 수 있는 종합유원시설이다. 지난해 5월에 개장한 파크 중앙 정원에는 지난 1년간 건강하게 자란 억새들의 황금빛 물결이 장관을 이룬다. ','축제/행사','33.3911825','126.3665285','Null','Null','제주특별자치도 제주시 애월읍 천덕로 880-24','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/04/d4e9c054-6038-42d8-bd3f-050eb926602a.jpg','9.81파크; 억새시즌'),('CNTS_200000000010815','제주시 조천읍 신흥리 227-5','https://api.cdn.visitjeju.net/photomng/imgpath/202011/20/9c097ea3-c43b-49dd-8561-353ffe7d5f16.jpg','제주 김택화 미술관','관광지','33.5447774','126.650164','010-3868-3846','-','제주특별자치도 제주시 조천읍 신흥로 1','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/20/fcee49ba-76ea-415d-88d9-85cbee75cf3d.jpg','김택화미술관'),('CNTS_200000000010833','제주시 연동 284-9','https://api.cdn.visitjeju.net/photomng/imgpath/202011/12/16be1b8d-071d-4434-a378-c3e9f741f599.jpg','20