항으로 있는데 돌로 쌓은 모양을 그대로 간직해 더욱 매력이 있는 곳이다. 한여름 낮엔 해수풀장에서 아이들이 뛰어 노는 소리로 가득찼던 곳이지만 지금은 거리두기 시행으로 운영을 하지 않고 있다. 저녁이 되면 포구를 둘러싸고 낚시하는 낚시꾼들이 오는데 무늬오징어 등이 잡힌다고 한다. 남원포구는 남원 읍내 가운데 있기 때문에 남원의 맛집들이 근처에 있어 식사하기에도 좋다.','관광지','33.2778272','126.7198433','Null','Null','제주특별자치도 서귀포시 남원읍 남태해안로 140','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202109/01/46570343-291e-433e-bc03-333783f3303b.JPG','남원항 (남원포구)'),('CNTS_200000000011917','서귀포시 남원읍 수망리 산 182-4','https://api.cdn.visitjeju.net/photomng/imgpath/202109/01/2ddf5f46-7b08-4d62-a24e-f1ebf75cbc8c.JPG','물영아리 맞은편 탐방로 입구부터 마흐니오름 정상까지는 편도 길이가 5.3km의 숲길이다. 총 10킬로 조금 넘으니 중간에 쉴 때 마실 물이나 김밥을 싸고 가는 것을 추천한다. 10킬로면 3시간 ~ 4시간 정도 걸린다. 숲길 처음에 들어서면 물이 조금 있는 제주의 곶자왈을 만날 수 있다.','관광지','33.3591208','126.6921366','Null','Null','제주특별자치도 서귀포시 남원읍 남조로 973','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202109/01/650197fc-4280-4d5d-b346-6695eeefc9d9.JPG','마흐니 숲길'),('CNTS_200000000011918','서귀포시 남원읍 태흥리 364-4','https://api.cdn.visitjeju.net/photomng/imgpath/202109/01/438c50ff-2006-4df0-8217-f2d16a7e2f74.JPG','서귀포 남원읍 태흥2리. 이곳에는 평일 오후 1시가 되면 태흥2리 옥돔경매장에 호루라기 소리가 들린다. 새벽에 하는 경매가 아니기 때문에 부담없이 경매를 볼 수 있다. 경매를 하고 바로 경매인에게 옥돔을 구매할 수 있어 싱싱한 제주산 옥돔을 찾는 사람들은 이곳에서 구매를 한다. 옥돔을 테마로 한 다양한 그림도 주변에 있어서 옥돔과 함께 사진을 찍어보자. 옥돔 경매장 바로 앞에는 경매장에서 구입한 옥돔으로 만든 요리를 판매하는 식당도 있다.','관광지','33.2883796','126.7510101','Null','Null','제주특별자치도 서귀포시 남원읍 남태해안로 508','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202109/01/b6807bc8-130b-4dcf-b501-e242218e6655.JPG','옥돔마을'),('CNTS_200000000011919','서귀포시 신효동 1200-6','https://api.cdn.visitjeju.net/photomng/imgpath/202109/01/3e850914-7398-4c34-b6a4-687888d2479e.JPG','감귤박물관에는 생이소리길이라는 월라봉 산책로가 잘 꾸며져 있다. 생이소리길로 감귤박물관 주변을 산책할 수 있는데 산책 코스는 천천히 걸으면 1시간 정도의 코스로 월라봉 정상바위까지 갈 수 있다. 정상바위에 오르면 저 멀리 지귀도까지 보인다. 탁 트인 공간을 마주하며 가슴이 뻥 뚫리는 시원한 느낌이 드는 곳이다.','관광지','33.2722449','126.6087952','Null','Null','제주특별자치도 서귀포시 효돈순환로 441','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202109/01/501100c5-a95e-4196-835f-83175cfe22d8.JPG','감귤박물관 월라봉 산책로