d.jpg','리가 사는 세상과 또 다른 세상을 연결 시켜주는 잃어버린 문, 1981년 어느날 노형수퍼마켙에 이 불안정한 문이 열려 제주의 색을 모두 빨아들인다. 문의 힘이 점점 커지면서 수퍼마켙조차 색을 잃어버렸지만 수퍼마켙의 중심엔 빨아들인 색깔들로 인해 이 세상에서는 볼 수 없는 신비로운 광경이 펼쳐지고 있다. 어쩌면 유치하지만, 한편으론 유쾌하고, 마지막에는 신비로움이 느껴지는 수퍼마켙 세상으로 들어가 보자.','관광지','33.4649309','126.4553144','064-713-1888','Null','제주특별자치도 제주시 노형로 89','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202110/14/882af75d-7ae6-4732-b49b-0315e199392f.jpg','노형수퍼마켙'),('CNTS_200000000012073','제주 제주시 한림읍 귀덕11길 19','https://api.cdn.visitjeju.net/photomng/imgpath/202111/26/1c231e85-5113-40b9-bc7f-bd79d7a94e9c.jpg','영등할망신화공원은 귀덕포구에서 해변을 따라 현무암으로 만들어진 좁은 돌길을 따라 약 1km 정도 이어진다. 길을 따라 걸으며 제주 신화를 알아보는 재미도 느껴보자.','관광지',NULL,NULL,'Null','Null','제주 제주시 한림읍 귀덕11길 19','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202111/26/5912fc7f-f99f-4994-af50-e3df74975ef5.jpg','영등할망 신화공원'),('CNTS_200000000012075','서귀포시 남원읍 서성로 919','https://api.cdn.visitjeju.net/photomng/imgpath/202111/26/4d4c5df7-dcfc-4eec-9f4b-4c1e3514a974.jpg','임진왜란 당시 전쟁에 사용할 말 500마리를 헌납하면서 국난극복에 기여한 김만일(1550~1632)을 기리기 위한 공간으로 2021년 8월 문을 열었다.','관광지',NULL,NULL,'064-805-9801','Null','서귀포시 남원읍 서성로 919','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202111/26/f523bcbc-0dc1-4b5f-9814-5927889f634d.jpg','헌마공신김만일기념관'),('CNTS_200000000012076','제주시 이호일동 1665-6','https://api.cdn.visitjeju.net/photomng/imgpath/202110/08/a4fa0153-0462-4857-a6cf-d954a72e95f0.jpg','해양쓰레기 팝업 전시 및 스토어 <Filter, 必터>가 오는 10월 23일까지 제주이호테우해변 종합상황실에서 열린다. \n\n<Filter, 必터>는 해양쓰레기를 활용하여 제주도 이호테우 해변의 콘텐츠를 개발하고 코로나로 침체된 이호지역을 활성화하는 재생프로젝트다.','축제/행사','33.4974623','126.4539093','Null','Null','제주특별자치도 제주시 도리로 15-20','https://api.cdn.visitjeju.net/photomng/thumbnailpath/202110/08/c2deb6c0-709f-4e8d-bb99-4369841ffb29.jpg','제주 해변에서 해양쓰레기의 심각성을 알리다, FILTER-必터'),('CNTS_200000000012077','Null','https://api.cdn.visitjeju.net/photomng/imgpath/202110/08/25dca989-b015-4b97-b310-2efc508c6a14.jpg','새로운 야간문화관광 콘텐츠로 제주시 도심 속 휴식공간인 신산공원에서 가을밤 아름다운 불이 켜진다\n\n10월 12일부터 10월 31일까지 20일간 많은 이들에게 공감과 위로를 줄 수 있는 「하트온,